import React from "react";
import "../styles/ExploreMore.css";

/**
 * ExploreMore - Two big promo cards (Loan / Buyback)
 * - Replace the icon/image paths or SVGs if you want custom art.
 * - Buttons are simple <button> elements so you can attach handlers or routing.
 */

export default function ExploreMore() {
  return (
    <section className="explore-more-section">
      <div className="explore-more-inner">
        <h2 className="explore-more-title">
          <span className="rule" />
          Explore More
          <span className="rule" />
        </h2>

        <div className="explore-more-grid">
          <PromoCard
            title="Loan"
            subtitle="Get your car financed today"
            cta="Check eligibility"
            // icon can be an img path or left as default svg
            iconPath= {process.env.PUBLIC_URL + "/paisa.png"}
            variant="loan"
            onClick={() => {
              // replace with navigation or modal open
              console.log("Open Loan eligibility");
            }}
          />

          <PromoCard
            title="Buyback"
            subtitle="Commit less, drive more"
            cta="Explore buyback"
            iconPath={process.env.PUBLIC_URL + "/buyback.png"}
            variant="buyback"
            onClick={() => {
              console.log("Open Buyback");
            }}
          />
        </div>
      </div>
    </section>
  );
}

function PromoCard({ title, subtitle, cta, iconPath, variant = "loan", onClick }) {
  return (
    <article className={`promo-card promo-${variant}`} role="region" aria-labelledby={`${variant}-title`}>
      {/* top-left icon label */}
      <div className="promo-label">
        <div className="promo-label-icon">
          {/* if you have an icon file, use <img src={iconPath} /> else we render an inline diamond icon */}
          {iconPath ? <img src={iconPath} alt="" /> : <InlineDiamondIcon />}
        </div>
        {/* <div className="promo-label-text">{title}</div> */}
      </div>

      {/* large background emblem: you can replace with SVG or image */}
      <div className="promo-hero" aria-hidden>
        <DecorativeGraphic variant={variant} />
      </div>

      {/* subtitle */}
      <div className="promo-copy">
        <div id={`${variant}-title`} className="promo-title">
          {title}
        </div>
        <div className="promo-sub">{subtitle}</div>
      </div>

      {/* CTA bar at bottom */}
      <div className="promo-cta-wrap">
        <button className="promo-cta" onClick={onClick}>
          {cta}
        </button>
      </div>
    </article>
  );
}

/* Simple inline decorative graphic (keeps everything local). Replace with custom SVG/images if you want. */
function DecorativeGraphic({ variant }) {
  // subtle different patterns per variant
  return (
    <svg className="promo-graphic" viewBox="0 0 600 400" preserveAspectRatio="xMidYMid slice" aria-hidden>
      <defs>
        <linearGradient id={`g-${variant}`} x1="0" x2="1">
          <stop offset="0%" stopColor="rgba(255,255,255,0.02)" />
          <stop offset="100%" stopColor="rgba(255,255,255,0.02)" />
        </linearGradient>
      </defs>

      {variant === "loan" ? (
        <>
          <circle cx="300" cy="200" r="140" fill="none" stroke="rgba(255,255,255,0.03)" strokeWidth="12" />
          <circle cx="300" cy="200" r="90" fill="none" stroke="rgba(255,255,255,0.02)" strokeWidth="8" />
          {/* center rupee symbol abstract */}
          <text x="50%" y="50%" fill="rgba(255,255,255,0.06)" fontSize="140" fontWeight="700" textAnchor="middle" dominantBaseline="middle" fontFamily="sans-serif">
            â‚¹
          </text>
        </>
      ) : (
        <>
          {/* buyback stacked icon outline */}
          <g transform="translate(160,40)" fill="none" stroke="rgba(255,255,255,0.03)" strokeWidth="10">
            <path d="M40 60 L120 10 L200 60 L120 150 Z" strokeLinecap="round" strokeLinejoin="round" />
            <path d="M60 80 L120 35 L180 80" strokeLinecap="round" strokeLinejoin="round" />
          </g>
          <rect x="240" y="120" width="120" height="120" rx="20" fill="rgba(255,255,255,0.02)" />
        </>
      )}
    </svg>
  );
}

function InlineDiamondIcon() {
  return (
    <svg width="28" height="28" viewBox="0 0 24 24" fill="none" aria-hidden>
      <rect x="6" y="6" width="12" height="12" rx="3" transform="rotate(45 12 12)" stroke="#fff" strokeWidth="1.8" />
    </svg>
  );
}
